query:
LOAD CSV WITH HEADERS FROM 'file:///Safeproduct.csv' AS row
MERGE (a:Safeproduct {
    SP_ID:row.SP_ID,
    safeProductNo: row.safeProductNo,
    name: row.name,
    safeProductId: row.safeProductId,
    safeProductCount: row.safeProductCount,
    productType: row.productType
});

LOAD CSV WITH HEADERS FROM 'file:///question.csv' AS row
MERGE (a:Question {
    questionId: row.question_id,
    questionIndex: row.question_index,
    questionContent: row.questionContent,
    questionNetCount: row.questionNetCount
});

LOAD CSV WITH HEADERS FROM 'file:///SYSTEM.csv' AS row
MERGE (a:SYSTEM {
    systemId: row.systemId,
    name: row.name,
    systemSecretLevel: row.systemSecretLevel
});

LOAD CSV WITH HEADERS FROM 'file:///netName.csv' AS row
MERGE (a:Netname {
    netId: row.netid,
    networkType: row.networkType,
    name: row.name
});

LOAD CSV WITH HEADERS FROM 'file:///Unit.csv' AS row
MERGE (a:Unit {
    unitId: row.unitId,
    unitType: row.unitType,
    name: row.name,
    unitArea: row.unitArea,
    unitRegion: row.unitRegion
});

LOAD CSV WITH HEADERS FROM 'file:///totalintergration.csv' AS row
MERGE (a:Totalintegrations {
    totalIntegrationId: row.overallintergrationUnit_id,
    name: row.name,
    totalIntegrationLevel: row.totalIntergrationLevel,
    totalIntegrationNo: row.totalIntergrationNo,
    validatedateend: row.validatedateend
});

LOAD CSV WITH HEADERS FROM 'file:///Terminaltype.csv' AS row
MERGE (a:Terminaltype {
    name:row.name,
    terminalTypeId: row.terminalTypeId,
    terminalSum: row.terminalSum
});
